import React from 'react';

const Liste = ({ clients }) => {
    return (
        <div>
            <h2>Liste des clients</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>Nom</th>
                        <th>Téléphone</th>
                        <th>Ville</th>
                        <th>CA</th>
                    </tr>
                </thead>
                <tbody>
                    {clients.length > 0 ? (
                        clients.map(client => (
                            <tr key={client.id}>
                                <td>{client.nom}</td>
                                <td>{client.Tel}</td>
                                <td>{client.ville}</td>
                                <td>{client.CA}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="4">Aucun client trouvé.</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
};

export default Liste;
